(1, 'Harry Potter and the Half-Blood Prince (Harry Potter  #6)', '1', '439785960', 'Harry Potter and the Half-Blood Prince is the sixth novel in J. K. Rowling\'s Harry Potter book series. Set during Harry Potter\'s sixth year at Hogwarts, Lord Voldemort is definitely back, and with a vengeance. Harry finds his world is yet again changing: wizards and witches and Muggles alike are dying, despite the efforts of the Ministry of Magic and the Order of the Phoenix. Despite the danger, Harry and his best friends, Ron and Hermione, return to the familiar life of Hogwarts for their sixth year. They find yet another Defence Against the Dark Arts teacher: Professor Snape. They begin their N.E.W.T. classes in preparation for life after Hogwarts, and Harry gets some much needed Potions help from the mysterious Half-Blood Prince. Quidditch is as popular as ever, Harry is nominated as Gryffindor Quidditch Captain.\r\n\r\nAs well, this book sees the re-introduction of the Slug Club, along with the appointment of a new Potions teacher, Horace Slughorn. Romance again comes to Hogwarts, and ', 652, '2-Harry Potter and the Half-Blood Prince.jpg', '2-harry_potter_and_the_half-blooded_prince.pdf', 7, 3, 3),
(2, 'Harry Potter and the Order of the Phoenix (Harry Potter  #5)', '2', '439358078', '\"Harry Potter is in his fifth year at Hogwarts School as the adventures continue. There is a door at the end of a silent corridor. And it\'s haunting Harry Potter\'s dreams. Why else would he be waking in the middle of the night, screaming in terror? Harry has a lot on his mind for this, his fifth year at Hogwarts: a Defence Against the Dark Arts teacher with a personality like poisoned honey; a big surprise on the Gryffindor Quidditch team; and the looming terror of the Ordinary Wizarding Level exams.\r\n\r\nBut all these things pale next to the growing threat of He-Who-Must-Not-Be-Named, one that neither the magical government nor the authorities at Hogwarts can stop. As the grasp of darkness tightens, Harry must discover the true depth and strength of his friends, the importance of boundless loyalty, and the shocking price of unbearable sacrifice. His fate depends on them all.\r\n\r\nThe book that took the world by storm. In his fifth year at Hogwarts, Harry faces challenges at every turn, fr', 870, 'harry potter final reader zone.jpeg', '3-3-harry_potter_and_the_order_of_phoenix.pdf', 7, 3, 3),
(3, 'Harry Potter and the Chamber of Secrets (Harry Potter  #2)', '3', '439554896', 'Harry Potter and the Chamber of Secrets (Harry Potter  #2) - Written by J.K. Rowling - Published by Scholastic', 352, 'hp2.jpeg', '3.pdf', 7, 39, 3),
(4, 'Harry Potter and the Prisoner of Azkaban (Harry Potter  #3)', '4', '043965548X', '\"Harry Potter is lucky to reach the age of thirteen, since he has already survived the murderous attacks of the feared Dark Lord on more than one occasion. But his hopes for a quiet term concentrating on Quidditch are dashed when a maniacal mass-murderer escapes from Azkaban, pursued by the soul-sucking Dementors who guard the prison. It\'s assumed that Hogwarts is the safest place for Harry to be. But is it a coincidence that he can feel eyes watching him in the dark, and should he be taking Professor Trelawney\'s ghoulish predictions seriously?\"', 435, '5-Harry Potter and the Prisoner of Azkaban.jpeg', '5-Hugo 2000 Nominee Novel - J. K. Rowling - Harry Potter and the Prisoner of Azkaban.pdf', 7, 1, 3),
(5, 'Harry Potter Boxed Set  Books 1-5 (Harry Potter  #1-5)', '5', '439682584', 'J.K. Rowling\'s Harry Potter novels are now available in these spectacular new editions, with beautifully designed jackets by renowned woodcut artist Andrew Davidson. This stylish boxed set includes all seven novels and is perfect for Harry Potter novices and collectors alike. Contains (in reading order): Harry Potter and the Philosopher\'s Stone, Harry Potter and the Chamber of Secrets, Harry Potter and the Prisoner of Azkaban, Harry Potter and the Goblet of Fire, Harry Potter and the Order of the Phoenix, Harry Potter and the Half-Blood Prince, and Harry Potter and the Deathly Hallows.', 2690, '6-Harry Potter Boxed Set Books 1-5.jpg', '5.pdf', 7, 39, 3),
(6, 'Unauthorized Harry Potter Book Seven News: ', '6', '976540606', 'Unauthorized Harry Potter Book Seven News: \"Half-Blood Prince\" Analysis and Speculation - Written by W. Frederick Zimmerman - Published by Nimble Books', 152, 'defaultbook.jpg', '6.pdf', 7, 39, 3),
(7, 'Harry Potter Collection (Harry Potter  #1-6)', '7', '439827604', 'Harry Potter Collection (Harry Potter  #1-6) - Written by J.K. Rowling - Published by Scholastic', 3342, '8-Harry Potter Collection.jpeg', '7.pdf', 7, 39, 3),
(8, 'The Ultimate Hitchhiker\'s Guide: Five Complete Novels and One Story (Hitchhiker\'s Guide to the Galaxy  #1-5)', '8', '517226952', 'The Ultimate Hitchhiker\'s Guide: Five Complete Novels and One Story (Hitchhiker\'s Guide to the Galaxy  #1-5) - Written by Douglas Adams - Published by Gramercy Books', 815, '9-The Ultimate Hitchhiker\'s Guide.jpeg', '8.pdf', 8, 72, 4),
(9, 'The Ultimate Hitchhiker\'s Guide to the Galaxy (Hitchhiker\'s Guide to the Galaxy  #1-5)', '9', '345453743', 'The Ultimate Hitchhiker\'s Guide to the Galaxy (Hitchhiker\'s Guide to the Galaxy  #1-5) - Written by Douglas Adams - Published by Del Rey Books', 815, '10-Hitchhikers-Guide-to-the-Galaxy.jpg', '9.pdf', 8, 72, 4),
(10, 'The Hitchhiker\'s Guide to the Galaxy (Hitchhiker\'s Guide to the Galaxy  #1)', '10', '1400052920', 'The Hitchhiker\'s Guide to the Galaxy (Hitchhiker\'s Guide to the Galaxy  #1) - Written by Douglas Adams - Published by Crown', 215, '11-Hitchhiker\'s Guide to the Galaxy1.jpg', '10.pdf', 8, 72, 4),
(11, 'The Hitchhiker\'s Guide to the Galaxy (Hitchhiker\'s Guide to the Galaxy  #1)', '11', '739322206', 'The Hitchhiker\'s Guide to the Galaxy (Hitchhiker\'s Guide to the Galaxy  #1) - Written by Douglas Adams/Stephen Fry - Published by Random House Audio', 6, 'defaultbook.jpg', '11.pdf', 1, 1, 1),
(12, 'The Ultimate Hitchhiker\'s Guide (Hitchhiker\'s Guide to the Galaxy  #1-5)', '12', '517149257', 'The Ultimate Hitchhiker\'s Guide (Hitchhiker\'s Guide to the Galaxy  #1-5) - Written by Douglas Adams - Published by Wings Books', 815, 'defaultbook.jpg', '12.pdf', 1, 1, 1),
(13, 'A Short History of Nearly Everything', '13', '076790818X', 'Have you always wanted to understand the natural world but found science classes tedious and science textbooks difficult to understand? Author Bill Bryson can relate—that was his motivation for researching and writing A Short History of Nearly Everything. The book is an accessible overview of the natural sciences that describes not only the important discoveries but also the unknowns and controversies that still exist in the sciences, like the mystery of missing mass in the universe and the puzzling details of human evolution.\r\n\r\nIn this guide, we’ve organized key topics from Bryson’s book into a concise chronology covering the origins of the universe, the geologic history of planet Earth, and the history of life on Earth. We’ll also analyze the scientific issues that Bryson brings up in light of recent scientific papers and compare his perspective to that of scientists like Stephen Hawking.', 544, '14-A Short History of Nearly Everything.jpg', '14-A Short History Of Nearly Everything.pdf', 9, 1, 5),
(14, 'Bill Bryson\'s African Diary', '14', '767915062', 'We meet at the Kenya Airways check-in desk at Heathrow, the five brave souls who are to form our party \r\nfrom London. In addition to me and Dan, they are: David Sanderson, a thoughtful and kindly fellow \r\njoining us now in his capacity as urban specialist; Justin Linnane, an intent but amiable young maker of \r\ntelevision documentaries; and the photographer Jenny Matthews. White-haired and sweetly unobtrusive, \r\nJenny is easily the wonder of the lot. If you saw her in a supermarket you would take her for a \r\nschoolteacher or civil servant. In fact, for 25 years she has gone wherever there is danger - to Chechnya, \r\nBosnia, Afghanistan, Rwanda. She is fearless and evidently indestructible. If things go bad on this trip, it \r\nis her I\'ll hold on to.\r\nIt is nighttime when we land at Jomo Kenyatta Airport and pleasantly cool. We are met by Kentice \r\nTikolo, an immensely good-natured Kenyan lady who helps run CARE\'s Nairobi office and who \r\nshepherds us into waiting cabs. In Out of Africa, N', 55, '15-Bill Bryson\'s African Diary.jpeg', '15-bill-brysons-african-diary.pdf', 10, 1, 5),
(15, 'Bryson\'s Dictionary of Troublesome Words: A Writer\'s Guide to Getting It Right', '15', '767910435', '\"Bryson\'s Dictionary of Troublesome Words: A Writer\'s Guide to Getting It Right\" is a reference book written by Bill Bryson. Unlike his travelogues and popular science books, this work is geared more towards writers, editors, and language enthusiasts. It serves as a guide to navigating common linguistic pitfalls and tricky grammar rules in the English language. Bryson provides explanations and examples to help clarify the correct usage of often-confused words, phrases, and punctuation marks. It\'s a handy resource for anyone looking to improve their writing skills and ensure accuracy and clarity in their communication.', 256, '16-Bryson\'s Dictionary of Troublesome Words.jpeg', '15.pdf', 9, 1, 4),
(16, 'In a Sunburned Country', '16', '767903862', '\"In a Sunburned Country\" is another travelogue written by Bill Bryson. In this book, Bryson recounts his journey through Australia, exploring its vast landscapes, unique wildlife, and quirky culture. He delves into the country\'s history, geography, and people with his signature blend of humor, curiosity, and insight. From the bustling cities to the remote Outback, Bryson provides entertaining anecdotes and fascinating facts about Australia, while also reflecting on his own experiences and encounters along the way. \"In a Sunburned Country\" is beloved by readers for its vivid descriptions, witty observations, and affectionate portrayal of the land Down Under.', 335, '17-in a sunburned country.jpeg', '16.pdf', 10, 1, 5),
(17, 'I\'m a Stranger Here Myself: Notes on Returning to America After Twenty Years Away', '17', '076790382X', '\"I\'m a Stranger Here Myself: Notes on Returning to America After Twenty Years Away\" is a collection of essays written by Bill Bryson. It chronicles Bryson\'s experiences and observations upon returning to his native United States after living abroad in England for two decades. \r\n\r\nThrough a series of humorous and insightful essays, Bryson reflects on the changes that have occurred in American society during his absence, as well as the quirks and idiosyncrasies of American culture that he rediscovers upon his return. From the challenges of reacclimating to American life to the absurdities of everyday encounters, Bryson offers witty commentary and astute observations on a wide range of topics, from technology and politics to food and consumerism.\r\n\r\n\"I\'m a Stranger Here Myself\" provides readers with a fresh perspective on familiar surroundings, as seen through the eyes of someone who is simultaneously an insider and an outsider in their own homeland. It\'s a delightful and entertaining rea', 304, '18-im a stranger to myself.jpeg', '17.pdf', 9, 6, 5),
(18, 'The Lost Continent: Travels in Small Town America', '18', '60920084', '\"The Lost Continent: Travels in Small Town America\" by Bill Bryson falls into the genre of travel literature. In this book, Bryson recounts his journey across the United States, exploring small towns and rural areas in search of the essence of American culture. It\'s a blend of memoir, travelogue, and social commentary, as Bryson reflects on his experiences, encounters with locals, and observations of American life. With his trademark wit and keen eye for detail, Bryson paints a vivid portrait of the landscapes, people, and quirks he encounters along the way, offering both humorous anecdotes and insightful reflections on the state of small-town America.', 299, '19-The Lost ContinentTravels in Small Town America.jpeg', '18.pdf', 10, 151, 5),
(19, 'Neither Here nor There: Travels in Europe', '19', '380713802', '\"Neither Here nor There: Travels in Europe\" by Bill Bryson belongs to the travel literature genre. In this book, Bryson recounts his journey through Europe, reflecting on his experiences, encounters with locals, and observations of European culture, history, and landscapes. It\'s a blend of memoir, travelogue, and social commentary, as Bryson shares his adventures, humorous anecdotes, and insightful observations of the various countries he visits. With his characteristic wit and keen sense of observation, Bryson offers readers an engaging and entertaining exploration of Europe\'s diversity and charm.', 254, '20-Neither Here nor There Travels in Europe.jpg', '20-Bill Bryson - Neither Here Nor There_ Travel_ope (v5.0).pdf', 10, 611, 5),
(20, 'Notes from a Small Island', '20', '0771017049', '\"Notes from a Small Island\" by Bill Bryson is also categorized as travel literature. In this book, Bryson recounts his farewell journey across Great Britain before returning to his native United States. It\'s a blend of memoir, travelogue, and social commentary, as Bryson shares his experiences, observations, and humorous anecdotes from his travels around England, Scotland, and Wales. With his characteristic wit, Bryson provides insights into British culture, history, and quirks, while also reflecting on his own nostalgia and fondness for the country he\'s called home for many years. \"Notes from a Small Island\" offers readers an affectionate and entertaining portrait of Britain, capturing both its charms and its idiosyncrasies.', 324, '21-Notes from a Small Island.jpeg', '21-Bill Bryson - Notes From a Small Island.pdf', 10, 1, 5),
(21, 'The Mother Tongue: English and How It Got That Way', '21', '380715430', '\"The Mother Tongue: English and How It Got That Way\" by Bill Bryson falls within the genre of popular linguistics. In this book, Bryson explores the history and evolution of the English language, tracing its origins from its Germanic roots to its global prominence today. He delves into various aspects of English, including its grammar, vocabulary, spelling, and pronunciation, while also examining the influences of other languages and cultures on its development.\r\n\r\nThrough engaging anecdotes, historical anecdotes, and linguistic insights, Bryson sheds light on the fascinating journey of English, offering readers a deeper understanding of how the language has shaped and been shaped by human history. \"The Mother Tongue\" is both informative and entertaining, making it accessible to a wide audience interested in language and its complexities.', 270, '22-The Mother Tongue English and How It Got That Way.jpeg', '21.pdf', 9, 1, 5),
(22, 'J.R.R. Tolkien 4-Book Boxed Set: The Hobbit and The Lord of the Rings', '22', '345538374', 'The \"J.R.R. Tolkien 4-Book Boxed Set\" includes \"The Hobbit\" and \"The Lord of the Rings\" trilogy. These books belong to the fantasy genre and are celebrated for their rich world-building, compelling characters, and epic adventures. \"The Hobbit\" follows the journey of Bilbo Baggins, a hobbit who is swept into an unexpected adventure to reclaim the Lonely Mountain and its treasure from the dragon Smaug.\r\n\r\n\"The Lord of the Rings\" trilogy consists of \"The Fellowship of the Ring,\" \"The Two Towers,\" and \"The Return of the King.\" It chronicles the quest to destroy the One Ring, which holds immense power and threatens to plunge Middle-earth into darkness. The story follows Frodo Baggins and his companions as they travel across Middle-earth, encountering allies and adversaries along the way.\r\n\r\nTogether, these books form the cornerstone of modern fantasy literature, inspiring generations of readers with their timeless themes of courage, friendship, and the struggle between good and evil. The bo', 1728, '23-the hobbit.jpg', '22.pdf', 7, 1, 11),
(23, 'The Lord of the Rings (The Lord of the Rings  #1-3)', '23', '618517650', '\"The Lord of the Rings\" series by J.R.R. Tolkien is a classic epic fantasy trilogy. The three books included in the series are:\r\n\r\n1. \"The Fellowship of the Ring\"\r\n2. \"The Two Towers\"\r\n3. \"The Return of the King\"\r\n\r\nThese books collectively tell the story of the quest to destroy the One Ring, an object of great power created by the Dark Lord Sauron. The series follows the adventures of various characters, including Frodo Baggins, Gandalf the Grey, Aragorn, Legolas, Gimli, and many others, as they journey across the lands of Middle-earth to Mount Doom, where the Ring was forged, in order to destroy it and defeat Sauron.\r\n\r\n\"The Lord of the Rings\" is renowned for its intricate world-building, rich mythology, and compelling characters. It has had a profound impact on the fantasy genre and continues to captivate readers with its timeless themes of friendship, heroism, and the struggle against darkness.', 1184, '24-The Lord of the Rings (The Lord of the Rings.jpeg', '24-1 - The Fellowship of the Ring.pdf', 7, 345, 11),
(24, 'The Fellowship of the Ring (The Lord of the Rings  #1)', '24', '618346252', '\"The Fellowship of the Ring\" is the first book in J.R.R. Tolkien\'s epic fantasy trilogy, \"The Lord of the Rings.\" In this volume, the story begins with the discovery of the One Ring by Bilbo Baggins, a hobbit from the Shire. The ring, which grants its bearer immense power but also corrupts them, sets in motion a chain of events that threaten the peace of Middle-earth.\r\n\r\nThe central protagonist, Frodo Baggins, inherits the ring from his uncle Bilbo and is tasked with the perilous quest to destroy it in the fires of Mount Doom, where it was forged. Frodo is joined by a fellowship composed of representatives from the free peoples of Middle-earth: Gandalf the wizard, Aragorn the ranger, Legolas the elf, Gimli the dwarf, Boromir of Gondor, and Frodo\'s hobbit companions, Sam, Merry, and Pippin.\r\n\r\nAs the fellowship embarks on their journey, they encounter numerous challenges, including dark creatures, treacherous landscapes, and the ever-looming threat of Sauron, the Dark Lord who seeks to ', 398, '25-The Fellowship of the Ring.jpeg', '25-24-1 - The Fellowship of the Ring.pdf', 7, 1, 11),
(25, 'The Lord of the Rings (The Lord of the Rings  #1-3)', '25', '618260587', 'The Lord of the Rings (The Lord of the Rings  #1-3) - Written by J.R.R. Tolkien/Alan  Lee - Published by Houghton Mifflin Harcourt', 1216, 'defaultbook.jpg', '25.pdf', 1, 1, 1),
(26, 'The Lord of the Rings: Weapons and Warfare', '26', '618391002', 'The Lord of the Rings: Weapons and Warfare - Written by Chris   Smith/Christopher  Lee/Richard Taylor - Published by Houghton Mifflin Harcourt', 218, 'defaultbook.jpg', '26.pdf', 1, 1, 1),
(27, 'The Lord of the Rings: Complete Visual Companion', '27', '618510826', 'The Lord of the Rings: Complete Visual Companion - Written by Jude Fisher - Published by Houghton Mifflin Harcourt', 224, 'defaultbook.jpg', '27.pdf', 1, 1, 1),
